Dulce Delight é um canal dedicado a confeitaria francesa e sua técnicas verdadeiras. Aqui você aprende essas técnicas sem atalhos, sem simplificar, tudo tim tim por tim tim pra conseguir fazer os doces tão lindos e saborosos quanto os que você vê nas Pâtisseries mundo afora.
Raiza Costa é artista, diretora de arte e chef de confeitaria radicada em Nova Iorque. Ela é bacharelada em Artes Visuais e frequentou o The French Culinary Institute of New York. Em 2010 ela decidiu criar o primeiro canal de confeitaria do Youtube, dedicado somente a sobremesas feitas sem o uso de corantes artificias e celebrando ingredientes frescos e orgânicos.  Sua série ganhou um Taste Awards San Francisco como a mais criativa do Youtube. Raíza foi uma das colaboradoras do canal do Jamie Oliver no Youtube e tem duas séries de tv no canal GNT, Rainha da Cocada e Doce Califórnia, além de uma série no Food Network nos Estados Unidos."><meta property="al:ios:app_store_id" content="544007664"><meta property="al:ios:app_name" content="YouTube"><meta property="al:ios:url" content="vnd.youtube://www.youtube.com/channel/UCDAd0PaRWMrGOMS6CjeQlXA"><meta property="al:android:url" content="https://www.youtube.com/channel/UCDAd0PaRWMrGOMS6CjeQlXA?feature=applinks"><meta property="al:android:app_name" content="YouTube"><meta property="al:android:package" content="com.google.android.youtube"><meta property="al:web:url" content="https://www.youtube.com/channel/UCDAd0PaRWMrGOMS6CjeQlXA?feature=applinks"><meta property="og:type" content="profile"><meta property="og:video:tag" content="confeitaria"><meta property="og:video:tag" content="doces"><meta property="og:video:tag" content="receitas de sobremesa"><meta property="og:video:tag" content="receitas francesas"><meta property="fb:app_id" content="87741124305"><meta name="twitter:card" content="summary"><meta name="twitter:site" content="@youtube"><meta name="twitter:url" content="https://www.youtube.com/channel/UCDAd0PaRWMrGOMS6CjeQlXA"><meta name="twitter:title" content="Dulce Delight Brasil"><meta name="twitter:description" content="O PRIMEIRO CANAL DO YOUTUBE DEDICADO A CONFEITARIA  ;)
